import React from "react"
// import RegistrationFormStyles from "./registrationForm.module.scss"
import {Wrapper,Grid,Flex} from "./styles"
import {Formik, FastField,Field,Form} from "formik"
import * as Yup from "yup"
import { Input,Button} from "components/common"
import {FacebookAuthLogin} from "components/modules/auth/facebook"
import {GoogleAuthLogin} from "components/modules/auth/google"

const initialValues = {
    LastName:"",
    FirstName:"",
    Email:"",
    Contact:"" 
}
const ValidationSchema = Yup.object({
    FamilyName:Yup.string().nullable().required("password"),
    GivenName:Yup.string().nullable().required("password"),
    Email:Yup.string().nullable().email().required("Enter your email"),
    Contact:Yup.string().nullable().required("Contact")
})
export default    ({children})=>{
    let onsubmit = async ({values,submittingProps})=>{
        console.log("this is ok")
    }

    return(
        <Wrapper >
            <Formik
                initialValues={initialValues}
                validationSchema={ValidationSchema}
                onSubmit={onsubmit}>
                    {({values,
                        handleSubmit,
                        handleBlur,
                        handleChange,
                        touched,
                        dirty,
                        isValid,
                        errors,
                        getFieldProps,
                        setFieldValue

                    })=>{
                        return(
                                <Form onSubmit={handleSubmit}>
                                    <Grid>
                                    <div>
                                            <label htmlFor="Email">First Name/Given Name</label>
                                            <Field
                                                component={Input}
                                                error={errors.hasOwnProperty("FirstName") && touched.hasOwnProperty("FirstName")? true : undefined }
                                                value={values.FirstName}
                                                {...getFieldProps("FirstName")}
                                                name="FirstName"
                                                placeholder="Enter You LastName"
                                                id="FirstName"
                                                />
                                    </div>
                                    <div>
                                            <label htmlFor="LastName">Last Name/ Family Name</label>
                                            <Field
                                                component={Input}
                                                error={errors.hasOwnProperty("LastName") && touched.hasOwnProperty("LastName")? true : undefined }
                                                value={values.LastName}
                                                {...getFieldProps("LastName")}
                                                name="LastName"
                                                placeholder="Enter You LastName"
                                                id="LastName"
                                                />
                                    </div>
                                        <div>
                                            <label htmlFor="Email">Email</label>
                                            <Field
                                                component={Input}
                                                error={errors.hasOwnProperty("Email") && touched.hasOwnProperty("Email")? true : undefined }
                                                value={values.Email}
                                                {...getFieldProps("Email")}
                                                name="Email"
                                                placeholder="Enter You Email"
                                                id="Email"
                                                />
                                        </div>

                                        <div>
                                            <label htmlFor="Contact">Contact</label>
                                            <Field
                                                component={Input}
                                                value={values.Contact}
                                                {...getFieldProps("Contact")}
                                                name="Contact"
                                                id="Contact"
                                                />
                                        </div>
                                        <div>
                                            <label htmlFor="Policy">I have read and aggreed to the policies and Aggreement</label>
                                            <Field
                                                component={Input}
                                                value={values.Contact}
                                                {...getFieldProps("Policy")}
                                                name="Policy"
                                                type="checkbox"
                                                id="Policy"
                                                />
                                        </div>
                                        <div>
                                            <label htmlFor="Aggreement"> I have read and aggreed to the policies and Aggreement</label>
                                            <Field
                                                component={Input}
                                                value={values.Aggreement}
                                                type="checkbox"
                                                {...getFieldProps("Aggreement")}
                                                name="Aggreement"
                                                id="Aggreement"
                                                />
                                        </div>

                                        <Button  disabled={dirty && isValid ? false: true } type="submit">Submit</Button>

                                        <Flex>
                                            <FacebookAuthLogin />
                                            <GoogleAuthLogin />
                                        </Flex>
                                    </Grid>
                                </Form>
                        )
                    }}
            </Formik>
        </Wrapper>
    )
}
